text:
#TCP329679
Any of you gents here, ever been in a relationship where your partner is older than you (it doesn't matter how many years older) or is currently in one? Who made the first move and how did it all go/went?

To the ladies;
If a younger guy approaches you as in wanna date you, would you have some kind of a thinking that he won't be that mature as you because he's younger or you have no such thinking and judge him base on his character?

To both ladies and gents;
Does age matter to you in a relationship? What an acceptable age gap for you in a relationship?

